  then []
  else
    (let f a x =
       let (m,n) = a in
       let x = (x * i) + m in
       if x > 9
       then
         let y =
           let rec helper num carry =
             if num < 10 then carry else helper (num - 10) (carry + 1) in
           helper x 0 in
         (y, ((x - (y * 10)) :: n))
       else (0, (x :: n)) in
     let base = (0, []) in
     let args = List.rev l in
     let (z,res) = List.fold_left f base args in
     match z with | 0 -> res | _ -> z :: res);;

